import React, {Component} from "react";

class Images extends Component {
    render() {
        return (
            <img src="https://s3-ap-southeats-1.amazonaws.com/niomic/img/sample/food1.jpg"
            alt="food" width="200" height="100"/>
        )
    }
} export default Images;
